import React from "react";
import "./index.css";

let getData = ( props ) => {

    let { x , y, z } = props;
    if(x === y && y == z){
        return (
            <>
            <h1>x + y + z</h1>
            <h2>All the Emojis are same</h2>
            </>
        )
    }

}



let Slot = () => {
    return (
        <>
            <div className = "slot">
            <getData one = "😄" two = "😄" three = "😄"/>
            <getData one = "😄" two = "🎅" three = "🍌"/>
            <getData one = "😄" two = "🍌" three = "🎅"/>
            

            </div>
        </>
    );
}

export default Slot;
